import React, { Component } from 'react';
import './Navigation.css';


class Navigation extends Component {

    render() {
        return(
            <nav>
                <h2 className="title"> { this.props.title } </h2>
                <ul>
                    <li> <a href="#"> Home </a> </li>
                    <li> <a href="#">Menu </a></li>
                    <li> <a href="#">About </a> </li>
                    <li> <a href="#"> Contact us</a> </li>
                </ul>

            </nav>
        );
    }

}

export default Navigation;
